      function setup() {
        createCanvas(420, 420);
        bg = loadImage(kv);
        noFill();
        strokeWeight(5);
        circleX = width / 2;
        circleY = height / 2;
        circleSize = 0;
        colorSize =255;
      }

      function draw() {
        background(bg);
        circleSize += 2;
        circleSizeX += 10;
        circleSizeY += 4;
        colorSize -= 1;
        
        stroke(255, 255,colorSize);
        strokeWeight(0.5);
        ellipse(circleX, circleY, circleSizeX, circleSizeY);
        ellipse(circleX, circleY, circleSizeX*0.5, circleSizeY*0.5);
        ellipse(circleX, circleY, circleSizeX*0.75, circleSizeY*0.75);
      }

      function mousePressed() {
        circleX = mouseX;
        circleY = mouseY;
        circleSizeX = 0;
        circleSizeY = 0;
        circleSize = 0;
        colorSize = 255;
        }
    </script>
    <style>
      #defaultCanvas0 {
        position: fixed; /*canvasを固定*/
        top: 0; /*canvasを上に固定*/
        left: 0;
        z-index: -1;
      }
    </style>
